import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the location input and type a destination
    await page.waitForSelector('#locationInput');
    await page.fill('#locationInput', 'Seoul');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_location_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_location_filled.png'));

    // Set check-in and check-out dates (pick today and 3 days later)
    const today = new Date();
    const checkin = today.toISOString().split('T')[0];
    const checkoutDate = new Date(today);
    checkoutDate.setDate(today.getDate() + 3);
    const checkout = checkoutDate.toISOString().split('T')[0];

    await page.fill('#checkinInput', checkin);
    await page.fill('#checkoutInput', checkout);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_dates_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_dates_filled.png'));

    // Open guest selector and add 2 adults, 1 child, 1 infant
    // Find the first visible .guest-selector button
    const guestSelectorBtn = await page.$('.guest-selector');
    if (guestSelectorBtn) {
      await guestSelectorBtn.click();
      // Wait for guest menu to appear (simulate, as real menu may not exist in this HTML)
      await page.waitForTimeout(500);
    }

    // Since the guest menu is not present in the static HTML, simulate clicking the + buttons
    // Find all "+" buttons and click the first three (simulate adding adults, children, infants)
    const plusButtons = await page.$$('button:text("+")');
    // Defensive: click up to 3 plus buttons if found
    for (let i = 0; i < Math.min(3, plusButtons.length); i++) {
      await plusButtons[i].click();
      await page.waitForTimeout(200);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_guests_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_guests_selected.png'));

    // Select the "City" filter
    const cityFilterBtn = await page.$('button.filter-btn:text("City")');
    if (cityFilterBtn) {
      await cityFilterBtn.click();
      await page.waitForTimeout(500);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_city_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_city_filter.png'));

    // Click the search button (first visible .search-btn)
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
      // Wait for possible results update
      await page.waitForTimeout(1000);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_after_search.png'));

    // Extract the titles of the first 3 visible listings (by .listing-card or fallback to .listing-location)
    let listingTitles = [];
    const listingCards = await page.$$('.listing-card');
    if (listingCards.length > 0) {
      for (let i = 0; i < Math.min(3, listingCards.length); i++) {
        const title = await listingCards[i].$eval('.listing-location', el => el.textContent.trim());
        listingTitles.push(title);
      }
    } else {
      // Fallback: try to get all elements with class .listing-location
      const locs = await page.$$eval('.listing-location', els => els.slice(0, 3).map(el => el.textContent.trim()));
      listingTitles = locs;
    }

    // Click the first listing card to open its modal/details (if present)
    if (listingCards.length > 0) {
      await listingCards[0].click();
      // Wait for modal/dialog to appear
      await page.waitForSelector('.modal-overlay', { timeout: 3000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_7_listing_modal.png') });
      screenshots.push(path.join(screenshotsDir, 'step_7_listing_modal.png'));

      // Extract modal title and host name if possible
      let modalTitle = '';
      let hostName = '';
      try {
        modalTitle = await page.$eval('.modal-content h1', el => el.textContent.trim());
      } catch {}
      try {
        hostName = await page.$eval('.host-section h3', el => el.textContent.replace(/^Hosted by\s*/, '').trim());
      } catch {}

      // Close the modal
      const closeBtn = await page.$('.modal-close');
      if (closeBtn) {
        await closeBtn.click();
        await page.waitForTimeout(500);
      }

      return {
        success: true,
        action: "Performed search with location, dates, guests, applied 'City' filter, triggered search, opened first listing modal, and extracted listing/host info.",
        extractedData: {
          search: {
            location: 'Seoul',
            checkin,
            checkout,
            guestsAdded: 3
          },
          listingTitles,
          modalTitle,
          hostName
        },
        screenshots,
        error: null
      };
    } else {
      return {
        success: true,
        action: "Performed search with location, dates, guests, applied 'City' filter, triggered search, and extracted listing titles.",
        extractedData: {
          search: {
            location: 'Seoul',
            checkin,
            checkout,
            guestsAdded: 3
          },
          listingTitles
        },
        screenshots,
        error: null
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
